import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

export default function SelectLabels() {
    const [foodBundle, setFoodBundle] = React.useState('');
    const [numOfFoodBundles, setNumOfFoodBundles] = React.useState('');
    const [customPeriod, setCustomPeriod] = React.useState('');
    const [mealType, setMealType] = React.useState('');
    const [open, setOpen] = React.useState(false);

    const handleFoodBundleChange = (event) => {
        const value = event.target.value;
        if (value === 'custom') {
            setOpen(true); // Open dialog for custom period
        } else {
            setFoodBundle(value);
        }
    };

    const handleNumOfFoodBundlesChange = (event) => {
        setNumOfFoodBundles(event.target.value);
    };

    const handleMealTypeChange = (event) => {
        setMealType(event.target.value);
    };

    const handleDialogClose = () => {
        setOpen(false);
    };

    const handleDialogSave = () => {
        if (customPeriod) {
            setFoodBundle(`Custom (${customPeriod} days)`);
        }
        setOpen(false);
    };

    const calculatePrice = () => {
        const customPeriodValue = parseInt(customPeriod, 10); // Convert customPeriod to a number

        if (foodBundle === 'monthly' && mealType === 'breakfast-lunch-dinner') {
            return 5100;
        }
        if (foodBundle === '22-days' && mealType === 'breakfast-lunch-dinner') {
            return 3740;
        }
        if (foodBundle === 'monthly' && mealType === 'lunch') {
            return 3000;
        }
        if (foodBundle.includes('Custom') && mealType === 'breakfast-lunch-dinner' && customPeriodValue) {
            return customPeriodValue * 170; // Custom period price for breakfast-lunch-dinner
        }
        if (foodBundle.includes('Custom') && mealType === 'lunch' && customPeriodValue) {
            return customPeriodValue * 100; // Custom period price for lunch
        }
        return 0;
    };

    return (
        <div>
            <FormControl sx={{ m: 1, minWidth: 120 }}>
                <InputLabel id="food-bundle-select-label">Food Bundle</InputLabel>
                <Select
                    labelId="food-bundle-select-label"
                    id="food-bundle-select"
                    value={foodBundle}
                    label="Food Bundle"
                    onChange={handleFoodBundleChange}
                >
                    <MenuItem value="">

                    </MenuItem>
                    <MenuItem >none</MenuItem>

                    <MenuItem value="monthly">Monthly (30 days)</MenuItem>
                    <MenuItem value="22-days">22 Days</MenuItem>
                    <MenuItem value="custom">Custom</MenuItem>
                </Select>
                <FormHelperText>Choose the food bundle</FormHelperText>
            </FormControl>

            <FormControl sx={{ m: 1, minWidth: 120 }}>
                <InputLabel id="meal-type-select-label">Meal Type</InputLabel>
                <Select
                    labelId="meal-type-select-label"
                    id="meal-type-select"
                    value={mealType}
                    label="Meal Type"
                    onChange={handleMealTypeChange}
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value="lunch">Lunch</MenuItem>
                    <MenuItem value="breakfast-lunch-dinner">
                        Breakfast + Lunch + Dinner
                    </MenuItem>
                </Select>
                <FormHelperText>Select meal type</FormHelperText>
            </FormControl>



            <Dialog open={open} onClose={handleDialogClose}>
                <DialogTitle>Set Custom Period</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        Enter the custom period for the food bundle (in days):
                    </DialogContentText>
                    <TextField
                        autoFocus
                        margin="dense"
                        id="custom-period"
                        label="Custom Period"
                        type="number"
                        fullWidth
                        variant="outlined"
                        value={customPeriod}
                        onChange={(e) => setCustomPeriod(e.target.value)}
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleDialogClose}>Cancel</Button>
                    <Button onClick={handleDialogSave} disabled={!customPeriod}>
                        Save
                    </Button>
                </DialogActions>
            </Dialog>

            {foodBundle && mealType && (
                <Typography sx={{ m: 2, fontWeight: 'bold' }}>
                    Total Price: {calculatePrice()} EGP
                </Typography>
            )}
        </div>
    );
}
